import React from 'react';

export default (props) => {
  if (props.isOpen === false) {
    return null;
  }

  return (
    <div class="modal">
      <h2>Modal</h2>
      <div>
        <button onClick={props.closeModal}>Close Modal</button>
      </div>
    </div>
  )
}
